import React from 'react';
import styled from 'styled-components';

//logo
import logo from '../assets/PneuS-03.png'

//image 
import mail from '../assets/Mail.png'
import facebook from '../assets/Facebook.png'
import phone from '../assets/phone.png'

//icons
import {GiPhone} from 'react-icons/gi'
import {MdMail} from 'react-icons/md'

const Styles = styled.div`
display:flex;
flex-direction:column;
align-items:center;
height:40vh;
font-size:16px;
.presentation{
    display:flex;
    flex-direction:row;
    align-items:center;
    justify-content:center;
    background-color:#eee;
    width:100%;
    height:30%;
    padding: 2% 0;
}
.coordonnee{
    display:flex;
    flex-direction:row;
    align-items:center;
    justify-content:center;
    width:100%;
    height:70%;
    padding: 0 2%;
    margin-top:1%;
}
.card-coordonnee{
    display:flex;
    flex-direction:row;
    align-items:center;
    justify-content:center;
    width:32%;
    height:100%;
    margin:0 2%;
    border-radius:10px;
}
.card-col-1{
    display:flex;
    flex-direction:column;
    align-items:center;
    justify-content:center;
    width:25%;
    height:60%;
    background: rgba(199, 7, 7, 0.85);
    border-radius:50%
}
.card-col-2{
    display:flex;
    flex-direction:column;
    align-items:flex-start;
    justify-content:center;
    width:70%;
    height:100%;
    padding-left:5%;
}

`;
function underHeader() {
    return(
        <React.Fragment>
            <Styles>
                
                <div className='coordonnee'>
                    <div className='card-coordonnee'>
                        <div className='card-col-1'>
                            <img
                                src={facebook}
                                width="29"
                                height="45"
                                className="logo"
                                alt="Logo Pneu service"
                            />
                        </div>
                        <div className='card-col-2'>
                            <p style={{fontSize:'1.5em', fontWeight:'900', color:'#999', margin:'0'}}>Facebook</p>
                            <p style={{fontSize:'1em', fontWeight:'500', color:'#555'}}> Contactez-nous sur <br/>Facebook.com/Pneu service</p>
                        </div>
                    </div>
                    <div className='card-coordonnee'>
                        <div className='card-col-1'>
                            <img
                                src={mail}
                                width="58"
                                height="55"
                                className="logo"
                                alt="Logo Pneu service"
                            />
                        </div>
                        <div className='card-col-2'>
                            <p style={{fontSize:'1.5em', fontWeight:'900', color:'#999', margin:'0'}}>Par Email</p>
                            <p style={{fontSize:'1em', fontWeight:'500', color:'#555'}}>disponible 7J/7 & 24h/24 <br/>djelloul.boubekri@gmail.com</p>
                        </div>
                    </div>
                    <div className='card-coordonnee'>
                        <div className='card-col-1'>
                            <img
                                src={phone}
                                width="52"
                                height="55"
                                className="logo"
                                alt="Logo Pneu service"
                            />
                        </div>
                        <div className='card-col-2'>
                         <p style={{fontSize:'1.5em', fontWeight:'900', color:'#999', margin:'0'}}>+213 557 932 082</p>
                         <p style={{fontSize:'1em', fontWeight:'500', color:'#555'}}> Du lundi au vendredi<br/> de 08h30 à 18h30, Délai moyen d'attente: 5s</p>
                        </div>
                    </div>
                </div>
                <div className='presentation'>
                    <p style={{fontSize:'1.2em', fontWeight:'500', color:'#888', marginRight:'0.5%'}}>Le pneu pas cher avec </p> 
                    <p style={{fontSize:'1.2em', fontWeight:'700', color:'rgba(199, 7, 7, 0.85)'}}>Pneuservice</p>
                    <p style={{fontSize:'1.2em', fontWeight:'500', color:'#888'}}>, Leader de la vente en ligne des pneus multimarque en Algérie.</p>
                </div>
            </Styles>
        </React.Fragment>
    )
}

export default underHeader;

